const container = {
  margin: '0 auto',
  padding: '20px 0 48px',
  width: '580px'
};

const userImage = {
  margin: '0 auto',
  marginBottom: '16px',
  borderRadius: '50%'
};

const heading = {
  fontSize: '32px',
  lineHeight: '1.3',
  fontWeight: '700',
  color: '#484848'
};

const paragraph = {
  fontSize: '18px',
  lineHeight: '1.4',
  color: '#484848'
};

const review = {
  ...paragraph,
  padding: '24px',
  backgroundColor: '#f2f3f3',
  borderRadius: '4px'
};

